Find the max value in nested array MongoDB<p>I have a collection with nested arrays as below:</p>
<pre><code>[
   {
      &quot;title&quot;:&quot;Foo&quot;,
      &quot;arr&quot;:[
         [
            {
               &quot;value&quot;:&quot;2021-11-13T00:00:00.000Z&quot;,
               &quot;baz&quot;:10
            },
            {
               &quot;value&quot;:&quot;2021-11-12T00:00:00.000Z&quot;,
               &quot;baz&quot;:0
            }
         ]
      ]
   },
   {
      &quot;title&quot;:&quot;Bar&quot;,
      &quot;arr&quot;:[
         [
            {
               &quot;value&quot;:&quot;2021-12-03T00:00:00.000Z&quot;,
               &quot;baz&quot;:10
            },
            {
               &quot;value&quot;:&quot;2021-12-07T00:00:00.000Z&quot;,
               &quot;baz&quot;:0
            }
         ]
      ]
   }
]
</code></pre>
<p>I want to filter out the largest value (i.e., latest date) for each document such that the result is:</p>
<pre><code>[
    {
        &quot;title&quot;: &quot;Foo&quot;,
        &quot;value&quot;: &quot;2021-11-13T00:00:00.000Z&quot;,
    },
    {
        &quot;title&quot;: &quot;Bar&quot;,
        &quot;value&quot;: &quot;2021-12-07T00:00:00.000Z&quot;,
    },
]
</code></pre>
<p>How can this query be written?</p>

