Flutter restheart oid mapping<p>Using flutter dio and retrofit I run into problems with a restheart API.</p>
<p>How does one properly map the mongodb oid?</p>
<p>I've got a main.dart like this:</p>
<pre><code>import 'dart:convert';
import 'package:dio/dio.dart';
import 'dart:developer';

import 'package:retrofit_experiment/utils/rest_client.dart';

var auth = 'Basic ' + base64Encode(utf8.encode('admin:secret'));

Future&lt;void&gt; main(List&lt;String&gt; args) async {
  final dio = Dio(); // Provide a dio instance
  dio.options.headers[&quot;authorization&quot;] = auth;

  final client = RestClient(dio);

  final json = await client.getUser(&quot;61a94d306c573846b4c0f8bf&quot;);

  log(
    'User with id 61a94d306c573846b4c0f8bf',
    name: 'getUser',
    error: jsonEncode(json),
  );

  client.getUser(&quot;61a94d306c573846b4c0f8bf&quot;).then((it) =&gt; print(it.id));

}
</code></pre>
<p>a rest_client.dart:</p>
<pre><code>import 'package:retrofit/retrofit.dart';
import 'package:dio/dio.dart';

import 'package:retrofit_experiment/model/user.dart';

part 'rest_client.g.dart';

@RestApi(baseUrl: &quot;http://localhost:8080&quot;)
abstract class RestClient {
  factory RestClient(Dio dio, {String baseUrl}) = _RestClient;

  @GET(&quot;/users/{id}&quot;)
  Future&lt;User&gt; getUser(@Path(&quot;id&quot;) String id);
}
</code></pre>
<p>which generates:</p>
<pre><code>// GENERATED CODE - DO NOT MODIFY BY HAND

part of 'rest_client.dart';

// **************************************************************************
// RetrofitGenerator
// **************************************************************************

class _RestClient implements RestClient {
  _RestClient(this._dio, {this.baseUrl}) {
    baseUrl ??= 'http://localhost:8080';
  }

  final Dio _dio;

  String? baseUrl;

  @override
  Future&lt;User&gt; getUser(id) async {
    const _extra = &lt;String, dynamic&gt;{};
    final queryParameters = &lt;String, dynamic&gt;{};
    final _data = &lt;String, dynamic&gt;{};
    final _result = await _dio.fetch&lt;Map&lt;String, dynamic&gt;&gt;(_setStreamType&lt;User&gt;(
        Options(method: 'GET', headers: &lt;String, dynamic&gt;{}, extra: _extra)
            .compose(_dio.options, '/users/$id',
                queryParameters: queryParameters, data: _data)
            .copyWith(baseUrl: baseUrl ?? _dio.options.baseUrl)));
    final value = User.fromJson(_result.data!);
    return value;
  }

  RequestOptions _setStreamType&lt;T&gt;(RequestOptions requestOptions) {
    if (T != dynamic &amp;&amp;
        !(requestOptions.responseType == ResponseType.bytes ||
            requestOptions.responseType == ResponseType.stream)) {
      if (T == String) {
        requestOptions.responseType = ResponseType.plain;
      } else {
        requestOptions.responseType = ResponseType.json;
      }
    }
    return requestOptions;
  }
}
</code></pre>
<p>and this user.dart:</p>
<pre><code>import 'package:json_annotation/json_annotation.dart';
part 'user.g.dart';

@JsonSerializable()
class User {
  @JsonKey(name: '_id.\$oid')
  String? id;
  @JsonKey(name: 'first_name')
  String? firstName;
  @JsonKey(name: 'last_name')
  String? lastName;
  String? avatar;
  String? email;

  User({this.id, this.firstName, this.lastName, this.avatar, this.email});

  factory User.fromJson(Map&lt;String, dynamic&gt; json) =&gt; _$UserFromJson(json);
  Map&lt;String, dynamic&gt; toJson() =&gt; _$UserToJson(this);
}
</code></pre>
<p>which generates:</p>
<pre><code>// GENERATED CODE - DO NOT MODIFY BY HAND

part of 'user.dart';

// **************************************************************************
// JsonSerializableGenerator
// **************************************************************************

User _$UserFromJson(Map&lt;String, dynamic&gt; json) {
  return User(
    id: json[r'_id.$oid'] as String?,
    firstName: json['first_name'] as String?,
    lastName: json['last_name'] as String?,
    avatar: json['avatar'] as String?,
    email: json['email'] as String?,
  );
}

Map&lt;String, dynamic&gt; _$UserToJson(User instance) =&gt; &lt;String, dynamic&gt;{
      r'_id.$oid': instance.id,
      'first_name': instance.firstName,
      'last_name': instance.lastName,
      'avatar': instance.avatar,
      'email': instance.email,
    };
</code></pre>
<p>I get the response data like this:</p>
<pre><code>{&quot;_id.$oid&quot;:null,&quot;first_name&quot;:&quot;Emma&quot;,&quot;last_name&quot;:&quot;…faces/3-image.jpg&quot;,&quot;email&quot;:&quot;emma.wong@reqres.in&quot;}
</code></pre>
<p>Everything gets properly mapped but not the oid.
What am I doing wrong?</p>

