Populate child collection<p>This is example from mongoose docs about populate:</p>
<pre><code>const personSchema = Schema({
  _id: Schema.Types.ObjectId,
  name: String,
  age: Number,
  stories: [{ type: Schema.Types.ObjectId, ref: 'Story' }]
});

const storySchema = Schema({
  author: { type: Schema.Types.ObjectId, ref: 'Person' },
  title: String,
});
</code></pre>
<p>So, <code>person</code> has list of <code>stories</code> and when we fetch <code>persons</code> we can include <code>stories</code> by using <code>populate('stories')</code>. So far so good.</p>
<p>But in order for that to work, when creating <code>Story</code>, we need to add <code>storyId</code> to <code>stories</code> list in <code>Person</code>. I am coming from <code>SQL</code> background, where that does not need to be done, it would find related <code>stories</code> automatically based on <code>authorId</code> on <code>Story</code>.</p>
<p>So the question is, can it be done in same way here, without need to update <code>stories</code> property on <code>Person</code>?</p>

