MongoDB running numbers within subsets of documents<p>I have a existing collection of ~12 million documents. I want to update one field in all the documents to have a running number within all groups of documents that share a common &quot;ref&quot; field. This would be a one time operation. Is there any way I can achieve this in MongoDB 4.4?</p>
<p>Simplified documents example:</p>
<pre><code>{&quot;_id&quot;: 1, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;aaaa&quot;}
{&quot;_id&quot;: 2, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;bbbb&quot;}
{&quot;_id&quot;: 3, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;cccc&quot;}
{&quot;_id&quot;: 4, &quot;ref&quot;: &quot;REF_B&quot;, &quot;description&quot;: &quot;dddd&quot;}
{&quot;_id&quot;: 5, &quot;ref&quot;: &quot;REF_B&quot;, &quot;description&quot;: &quot;eeee&quot;}
...
</code></pre>
<p>Desired modified output:</p>
<pre><code>{&quot;_id&quot;: 1, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;aaaa1&quot;}
{&quot;_id&quot;: 2, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;bbbb2&quot;}
{&quot;_id&quot;: 3, &quot;ref&quot;: &quot;REF_A&quot;, &quot;description&quot;: &quot;cccc3&quot;}
{&quot;_id&quot;: 4, &quot;ref&quot;: &quot;REF_B&quot;, &quot;description&quot;: &quot;dddd1&quot;} &lt;- reset count because ref changed
{&quot;_id&quot;: 5, &quot;ref&quot;: &quot;REF_B&quot;, &quot;description&quot;: &quot;eeee2&quot;}
...
</code></pre>
<p>The running number is concatenated to description field here. As soon as the &quot;ref&quot; changes, the concat number counter should reset and start from 1 again. When sorted by &quot;_id&quot; all the same refs are already together. Order matters.</p>
<p>I've been looking at aggregations to solve this, but it seems I would need a way to refer to previous documents and could not figure it out yet.</p>
<p>The best I could find is this thread:
<a href="https://stackoverflow.com/questions/35174554/add-some-kind-of-row-number-to-a-mongodb-aggregate-command-pipeline">Add some kind of row number to a mongodb aggregate command / pipeline</a>
But does not seem to suit my case where row number is being reset under a condition.</p>

